//贪心
int jump_(vector<int>& v)
{
    int pos = v.size() - 1;
    int step = 0;
    while(pos > 0)
    {
        for(int i = 0; i < pos; ++i)
        {
            if(i + v[i] >= pos)
            {
                pos = i;
                ++step;
                break;
            }
        }
    }

    return step;
}

int jump(vector<int>& v)
{
    int step = 0, maxPos = 0, n = v.size(), end = 0;

    for(int i = 0; i < n - 1; ++i)
    {
        if(maxPos >= i)
        {
            maxPos = max(maxPos, v[i] + i);
            if(i == end)
            {
                end = maxPos;
                ++step;
            }
        }
    }

    return step;
}

int jp(vector<int>& v)
{
    int step = 0, n = v.size(), end = 0, maxPos = 0;
    for(int i = 0; i < n - 1; ++i)
    {
        //maxPos代表当前可探索的最长路径
        if(maxPos >= i)
        {
            //发现更远的要及时更新
            maxPos = max(maxPos, v[i] + i);
            if(end == i)//探索到的上一个最远路径，步数+1
            {
                end = maxPos;
                ++i;
            }
        }
    }

    return step;
}

